  private def subsetSumTestCase(subsetSum: SubsetSum, numbersString: String, againstStrings: String, resultsStrings: String): Unit = {
    val numbers = readInts(numbersString)
    println(numbers.sorted)
    val againstStringsArray = againstStrings.split("\n")
    val resultStringsArray = resultsStrings.split("\n")
    for (i <- 0 until againstStringsArray.length) {
      println(i)
      assert(subsetSum.subsetSum(numbers, againstStringsArray(i).toInt) == resultStringsArray(i).toInt)
    }
  }

  private def readInts(string: String) = {
    val strings1 = string.split(" ")
    val ints1 = new ListBuffer[Int]()
    for (string <- strings1)
      ints1.append(string.toInt)
    ints1.toList
  }
